DELIMITER //
DROP PROCEDURE IF EXISTS temp_tbl//
CREATE PROCEDURE temp_tbl (IN cnt INT)
BEGIN
	DECLARE i INT DEFAULT 0;
	WHILE i < cnt DO
		UPDATE adverts 
		SET header = LEFT((SELECT body FROM messages ORDER BY RAND() LIMIT 1),100)
		WHERE id = i;
	
		UPDATE adverts 
		SET body = (SELECT body FROM messages ORDER BY RAND() LIMIT 1)
		WHERE id = i;
		SET i = i + 1;
	END WHILE;
END//
DELIMITER ;



CALL temp_tbl(89);






















